import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
// const elem = <h2>Hello world!</h2>
// const elem = React.createElement('h2', {className: 'greetings', children: " Привет"}, 'Hello!')
const elem = (
    <div>
        <h2>Hello</h2>
        <input type="text" />
        <button/>
    </div>
)
root.render(elem, <App/>);
